import React from 'react';
import './Services.css';

function Services() {
  return (
    <>
      <div className='services-container'>
        <h1 className='services-header'>services</h1>
        <h1 className='brand'></h1>
        <h1 className='communication'></h1>
        <h1 className='partnerships'></h1>
        <h1 className='policy'></h1>
        <h1 className='scenario'></h1>
      </div>
    </>
  );
}

export default Services;
